const Footer = () => {
    return(
        <footer>
            <section className="footer-text"><span className="test">TESTAR O PREMIUN DE GRAÇA</span>
            <span classN="text-inscreva">Inscreva-se para curtir música ilimitada e podscasts só com alguns anúncios. Não precisa de cartão de crédito</span> </section><button className="inscreva__button">Inscreva-se gratis</button>
        </footer>
    )
}
export default Footer;
